import React from "react";
import "../../styles/services.css";

const Services = () => {
  return <>
  <section id="service">
    <div className="container">
        <div className="services__top-content">
            <h6 className="subtitle">Our Services</h6>
        </div>
    </div>
  </section>
  </>
};

export default Services;
